import Axios from "axios";

const token = localStorage.getItem("token");

const axios = Axios.create({
  baseURL: "http://localhost:4000",
  headers: {
    "Content-Type": "application/json",
    "token": token ? `bea${token}` : "",  
  }
});

export default axios
